import PageLayout from '../../../components/page/PageLayout';
import Card from './components/Card';
import api from '../../../api/InteManagement';
export default {
  name: 'WorkRecoding',
  components: {
    Card: Card,
    PageLayout: PageLayout
  },
  data: function data() {
    return {
      workRecodingList: []
    };
  },
  mounted: function mounted() {
    var _this = this;

    api.getWorkRecodingList(this.$store.getters.projectSelected.id).then(function (data) {
      _this.workRecodingList = data.sort(function (x, y) {
        return x.id < y.id;
      });
    });
  },
  computed: {}
};
